import React, { Component } from 'react'
import Item from '../Item'
export default class ArticleOnlineList extends Component {
  state = {
    essayList: [
      { id: "1", name: "Title1", from: "新京报",date:"2021.1.1 12:31" },
      { id: "2", name: "Title2", from: "新京报",date:"2021.1.1 12:31" },
      { id: "3", name: "Title3", from: "新京报",date:"2021.1.1 12:31" },
    ],
  }
  render() {
    const {essayList}= this.state
    return (
      <div className = "list">
        {
          essayList.map((essayObj)=>{
            return (<Item {...essayObj}/>)
          })
        }
      </div>
    )
  }
}
